const StarsRating = ({rating}) => {
    
    const starsRating = process.env.PUBLIC_URL + '/5 Stars Rating.png';

    return (
        <div className='show-book-rating'>
            {[...Array(5)].map((star, i) => {
                const ratingVal = i+1

                return <FaStar size= {40} className='star' value = {ratingVal}/>
            })}
        </div>
    )
}

export default StarsRating
